export default function follower(p) {
  p.setup = () => {
    p.createCanvas(p.win.x, 500)
    p.background(255,0,0)
  }

  p.draw = () => {
    p.background(0, 255, 0)
  }

  window.onresize = () => {
    p.resizeCanvas(100, 90)
  }
}
